import React from "react";
import "./styles.scss";
import { AiOutlineUser } from 'react-icons/ai';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


const FormLogin = () => {
  return (
    <div className="form">
      <section className="form__container">
        <h2 className="form__container--title">Inicio de Sesión</h2>
        <div className="form__container--input-container">
          <input
            className="form__container--input-container--input"
            type="text"
            placeholder="Usuario"
            value=''
          />
          <input
            className="form__container--input-container--input"
            type="password"
            placeholder="Contraseña"
            value=''
          />
        </div>
        <Button className="btn form__container--button btn-primary">Iniciar sesión</Button>
      </section>
    </div>
  );
};

export default FormLogin;
